import React from 'react';
import { Container, Row, Col, Card, Button, Alert } from 'react-bootstrap';
import useServerDrivenUI from '../hooks/useServerDrivenUI';

const TestServerDrivenUI = () => {
  const userContext = {
    userId: '60d21b4667d0d8992e610c85',
    userRole: 'customer',
    deviceType: 'desktop'
  };

  const { layout, loading, error, refreshLayout } = useServerDrivenUI('home', 'home-main', userContext);

  return (
    <Container className="py-5">
      <h1 className="mb-4">Server-Driven UI Test</h1>

      <Row className="mb-4">
        <Col>
          <Button onClick={refreshLayout} variant="primary">
            Refresh Layout
          </Button>
        </Col>
      </Row>

      {loading && (
        <Alert variant="info">
          <strong>Loading...</strong> Fetching layout from server
        </Alert>
      )}

      {error && (
        <Alert variant="danger">
          <strong>Error:</strong> {error}
        </Alert>
      )}

      {layout && (
        <div>
          <Card className="mb-4">
            <Card.Header>
              <h5>Layout Information</h5>
            </Card.Header>
            <Card.Body>
              <Row>
                <Col md={6}>
                  <p><strong>Page Type:</strong> {layout.pageType}</p>
                  <p><strong>Page ID:</strong> {layout.pageId}</p>
                  <p><strong>Name:</strong> {layout.name}</p>
                  <p><strong>Version:</strong> {layout.version}</p>
                </Col>
                <Col md={6}>
                  <p><strong>Components:</strong> {layout.components.length}</p>
                  <p><strong>Title:</strong> {layout.metadata?.title}</p>
                  <p><strong>Description:</strong> {layout.metadata?.description}</p>
                </Col>
              </Row>
            </Card.Body>
          </Card>

          <Card>
            <Card.Header>
              <h5>Components</h5>
            </Card.Header>
            <Card.Body>
              {layout.components.map((component, index) => (
                <div key={component.id} className="mb-3 p-3 border rounded">
                  <h6>Component {index + 1}: {component.type}</h6>
                  <p><strong>ID:</strong> {component.id}</p>
                  <p><strong>Config:</strong> {JSON.stringify(component.config, null, 2)}</p>
                  <p><strong>Data:</strong> {JSON.stringify(component.data, null, 2)}</p>
                </div>
              ))}
            </Card.Body>
          </Card>
        </div>
      )}
    </Container>
  );
};

export default TestServerDrivenUI;
